import images from "./imgs.js";
import imgcard from "./imgcard.js";


function createcard(props)
{
  return(
    <div>
      <imgcard />
    </div>
  );
}

function App() {
  return (
    <div >
      {images.map(createcard)}
    </div>
  );
}

export default App;
